#include <array>
#include <cstdint>
#include <cstdlib>
#include <iostream>
#include <vector>

#include <daw/daw_benchmark.h>
#include <daw/daw_string_view.h>

#include "day_05.h"

namespace daw {
	namespace aoc_2018 {
		namespace day05 {
			template<typename T, typename U>
			constexpr void expecting( T &&expected_result, U &&result ) noexcept {
				if( expected_result != result ) {
					std::cerr << "Invalid result. Expecting '" << expected_result
					          << "' but got '" << result << "'\n";
					std::terminate( );
				}
			}

			using namespace daw::string_view_literals;

			static constexpr daw::string_view const polymer =
			  ""_sv;

		} // namespace day05
	}   // namespace aoc_2018
} // namespace daw

int main( ) {
	auto result = daw::alchemical_reduction( daw::aoc_2018::day05::polymer );
	daw::aoc_2018::day05::expecting( result, 9154U );
	auto result2 = daw::smallest( daw::aoc_2018::day05::polymer );
	daw::aoc_2018::day05::expecting( result2, 4556U );
}
